    console.log(this)
   }

  render() {
	return(
	  <div className= "highlight" onClick={this.props.toggleDisplay} onMouseEnter={this.props.mouseEnter} onMouseLeave={this.props.mouseExit}> 
		<h4>{this.props.project.name}</h4>
	  </div>
	)
  }
}

export default Projects
